import React, { useState } from 'react';
import "./HomeNavbar.scss";

import {
  Collapse,
  Navbar,
  NavbarToggler,
  NavbarBrand,
  Nav,
  NavItem,
  NavLink,
} from 'reactstrap';

const HomeNavbar = (props) => {
  const [isOpen, setIsOpen] = useState(false);

  const toggle = () => setIsOpen(!isOpen);

  return (
    <div className="d-flex w-100">
      <Navbar className="home-navbar" light expand="md">
        <NavbarBrand href="/">Home</NavbarBrand>
        <NavbarToggler onClick={toggle} />
        <Collapse isOpen={isOpen} navbar>
          <Nav className="d-flexmr-auto" navbar>
            <NavItem>
              <NavLink href="/">Conhecendo a serra</NavLink>
            </NavItem>
            <NavItem>
              <NavLink href="/">Ver denúncias/feedbacks</NavLink>
            </NavItem>
            <NavItem>
              <NavLink href="/">Realizar uma denúncia/feedback</NavLink>
            </NavItem>
          </Nav>
        </Collapse>
      </Navbar>
    </div>
  );
}

export default HomeNavbar;
